'''
Frequentist Inference Component - POS Tagger
'''
def pos_tag(posts):
    pos_tags = []
    for post in posts:
        tag = []
        for word in post:
            te = nltk.pos_tag([word])
            t = te[0]
            if t[1].startswith('NN') or t[1].startswith('JJ'):
                tag.append(t)
        pos_tags.append(tag)
    return pos_tags


# In[9]:

'''
Write POS TAG output to file
'''
def write_to_file(filename, posts):
    o = open(filename,'w')
    pos = pos_tag(posts)
    o.write(str(pos))
    o.close()


