'''
Creating post frame
'''
def create_post_frame(pos_tag_list, tag_column):
    posts = []
    tags = []
    for i in range(len(pos_tag_list)):
        post_row = []
        ptl = pos_tag_list[i]
        tc = tag_column[i]
        tags.append(tc)
        for p in ptl:
            post_row.append(p[0])
        posts.append(post_row)
    frame = pd.DataFrame({0 : posts,
                          1 : tags})
    return frame


# In[13]:

'''
Creating post frame with userids
'''
def create_post_frame_user(pos_tag_list, tag_column, userids):
    posts = []
    tags = []
    users = []
    for i in range(len(pos_tag_list)):
        post_row = []
        ptl = pos_tag_list[i]
        tc = tag_column[i]
        uc = userids[i]
        users.append(uc)
        tags.append(tc)
        for p in ptl:
            post_row.append(p[0])
        posts.append(post_row)
    frame = pd.DataFrame({0 : posts,
                          1 : tags,
                          2 : users})
    return frame


