'''
Compute Probability - FREPOS
'''
def probability(so, tags, post_frame):
    s_prob_t = {}
    for tag in tags:
        s_prob = {}
        count = 0
        for word in so:
            word = word[0]
            s_prob[word] = 0
            for i in range(len(post_frame)):
                if word in post_frame[0][i] and tag in post_frame[1][i]:
                    s_prob[word] = 1
                    count += 1
                    break
        if count > 0:
            s_prob_t[tag] = count/len(s_prob)
    return s_prob_t


