def bic_output(dictionary, tot_so):
    output = []
    for so in tot_so:
        word_tag = {}
        for word in so:
            for k, v in dictionary.items():
                if word[0] in v:
                    word_tag[k] = v[word[0]]
        output.append(word_tag)
    return output


# In[21]:

def getTotalProbability(tot_so, tags, soNtags):
    probs = []
    for so in tot_so:
        try:
            probs.append(probability(so, tags, soNtags))
        except:
            continue
    return probs


